export function add11(a: number, b: number): number {
  return a + b;
}

export function subtract11(a: number, b: number): number {
  return a - b;
}

export function multiply11(a: number, b: number): number {
  return a * b;
}

export function divide11(a: number, b: number): number {
  return a / b;
}
